    return (
        <>
            <Hero>
                <Banner title="Bem-vindo" subtitle="Aqui poderá reservar os serviços que procura sem sair de casa">
                    <Link to='/cabeleireiros' className="btn-primary">
                        Cabeleireiros
                </Link>
                <strong> </strong>
                <Link to='/barbeiros' className="btn-primary">
                        Barbeiros
                </Link>
                </Banner>

            </Hero>


        </>
    );
}
